import React from "react";
import {
  //   useGetData,
  usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import { Button, Modal } from "antd";
import { useState } from "react";
import "antd/dist/reset.css";
import { PlusOutlined } from "@ant-design/icons";
import { useForm } from "react-hook-form";
import {
  Cascader,
  Checkbox,
  DatePicker,
  Form,
  Input,
  InputNumber,
  Radio,
  Select,
  Switch,
  TreeSelect,
  Upload,
} from "antd";
const { RangePicker } = DatePicker;
const { TextArea } = Input;

export default function PostProduct() {
  const post = usePostData("/products");
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => console.log(data);
  console.log(errors);
  const data = {
    type: "max",
    active: true,
    size: "13.3",
    gender: "BOTH",
    color: "gray",
    name_Ru: "мaк",
    name_Uz: "mac",
    name_En: "Mac",
    price: 1199.99,
    discount: 10,
    description_Uz: "makbook air",
    description_Ru: "макбук эйр",
    description_En: "MacBook air",
    categoryId: "016fc031-2174-4cac-a6fd-98a29d141745",
    photoId: "873647384732463976t4",
  };

  const postData = () => {
    post.mutate(data, {
      onSuccess: (post) => console.log(post, "data"),
      onError: (error) => console.log(error, "error"),
    });
  };

  //   if (isLoading) {
  //     return <p>isLoading</p>;
  //   }
  //   if (isError) {
  //     return <p>error check your internet</p>;
  //   }
  const [open, setOpen] = useState(false);
  return (
    <div>
      <>
        <Button type="primary" onClick={() => setOpen(true)}>
          Create post
        </Button>
        <Modal
          title="Create post"
          centered
          open={open}
          onOk={() => setOpen(false)}
          onCancel={() => setOpen(false)}
          width={1000}
        >
          <>
            {/* <Checkbox
              checked={componentDisabled}
              onChange={(e) => setComponentDisabled(e.target.checked)}
            >
              Form disabled
            </Checkbox> */}
            <form onSubmit={handleSubmit(onSubmit)}>
              <input type="text" placeholder="Type" {...register("Type", {})} />
              <input
                type="checkbox"
                placeholder="Active"
                {...register("Active", {})}
              />
              <input
                type="number"
                placeholder="Size"
                {...register("Size", {})}
              />

              <input {...register("Gender")} type="radio" value="Both" />
              <input {...register("Gender")} type="radio" value=" Men" />
              <input {...register("Gender")} type="radio" value=" Woman" />
              <input
                type="text"
                placeholder="Color"
                {...register("Color", {})}
              />
              <input
                type="text"
                placeholder="Name_UZ"
                {...register("Name_UZ", {})}
              />
              <input
                type="text"
                placeholder="Name_RU"
                {...register("Name_RU", {})}
              />
              <input
                type="text"
                placeholder="Name_EN"
                {...register("Name_EN", {})}
              />
              <input
                type="number"
                placeholder="Price"
                {...register("Price", {})}
              />
              <input
                type="number"
                placeholder="Discount"
                {...register("Discount", {})}
              />
              <input
                type="text"
                placeholder="Description_Uz"
                {...register("Description_Uz", {})}
              />
              <input
                type="text"
                placeholder="description_RU"
                {...register("description_RU", {})}
              />
              <input
                type="text"
                placeholder="description_EN"
                {...register("description_EN", {})}
              />
              <input
                type="number"
                placeholder="Category_ID"
                {...register("Category_ID", {})}
              />
              <input
                type="number"
                placeholder="Photo_id"
                {...register("Photo_id", {})}
              />

              <input type="submit" />
            </form>
          </>
        </Modal>
      </>
    </div>
  );
}
